    <Container fluid className="p-0">
      <Row>
        <Col lg={10} xl={8} className="col-xxl-7 mx-auto">
          <h1>Environment Variables</h1>
          <hr className="my-4" />
          <Intro />
          <Adding />
          <Accessing />
          <LearnMore />
        </Col>
      </Row>
    </Container>
  </React.Fragment>
);

export default EnvironmentVariables;

